import React from "react";
import "./style.css";

function A2 () {
    return (
        <div id="a2">
            <img src="https://truffle-shuffle.s3.us-east-2.amazonaws.com/Assets/img/Quercus_nigra_acorns_03.jpg" alt="acorns" />
            <div>
                <h4>Create an account to save images</h4>
                <p className="small">Make the most of our collections.</p>
            </div>
        </div>
    );
}

export default A2;
